import React, { Component } from 'react'
import Header from '../../Parts/Header/Header'
import Card from '../../General/Cards/Card'
import './Gallery.css'

class Gallery extends Component {
  render() {
    return (
      <div className="bgProj">
        <Header/>
        <div id="content" class="container-fluid row mt-5 pt-3 justify-content-end">
        <div class="card border-0 col-12 col-md-3 rounded-lg cardItem hovereffect ">
          <img class="card-img-top cardItem rounded-lg img-responsive" src="img/projects/arch2.JPG" alt="Card image"/>
          <div class="card-img-overlay">
            <div class="overlay text-center overlay ">
              <h2 class="mt-auto"><a href="home.html" class="text-light">Archeticture </a></h2>
            </div>
            {/* <!-- <p class="card-text">Some example text.</p>
            <a href="#" class="btn btn-primary">See Profile</a>  --> */}
          </div>
        </div>
        </div>

      </div>
    );
  }
}

export default Gallery
